    if mibBuilder.loadTexts: heMpegCommonMIB.setRevisionsDescriptions(('Resolved compile errors: 1. LAST-UPDATED date matches last REVISION date. 2. Removed illegal characters such as line feed (ascii 0xa0). 3. Added mpegInputTSActiveConnection to at least one conformance group. 4. Removed extra mpegSessionsGroup in compliance statement.', '1. Added mpegInputTSActiveConnection entry. 2. Added mpegInputTSOutputSessionCreateTime. 3. Added mpegInputUdpOriginationInputTSIndex. 4. Added mpegOutputUdpDestinationOutputTSIndex.', 'Fixed spelling mistakes.', 'Changes included in the SCTE F2F meetings July 9-10 and Sept 24-25 1. mpegInputTSEntry, mpegOutputTSEntry, mpegProgESEntry are no longer indexed by ifIndex. 2. mpegInputTSTransportType and mpegInputTSPacketsDetected removed from mpegInputTSEntry to accomodate the Input extensibility such as udpOrigination. 3. Added to mpegInputTSEntry mpegInputTSConnectionType and mpegInputTSConnection. 4. mpegInputTSPatVersion and mpegInputTSCatVersion value -1 added to indicate unknown or not supported. 5. MpegProgESEntry sequence elements names updates to align with mpegProgES* prefix. 6. mpegStatsStreamTable renamed to mpegInputStatsTable. 7. mpegInputStatsPcrJitter and mpegInputStatsMaxPacketJitter support value -1 to indicate not supported measurement. 8. Added mpegInputUdpOriginationTable and mpegOutputUdpOriginationTable to generalize the input/output TS construct. 9. Updated parent OID of mpegInsertPacketTable to reflect the output nature of the construct. 10. Renamed mpegInsertPacketDeviceIndex as mpegInsertPacketDeviceIfIndex. 11. mpegOutputStatsTotalPackets set to 64 bits counter. 12.mpegOutputStatsChannelUtilization units set to 1 tenth of percent. 13. Added to mpegOutputTSEntry mpegOutputTSConnectionType and mpegOutputTSConnection. 14. mpegOutputProgNo changed ACCESS to read-only. 15. mpegOutputProgESPid renamed to mpegOutputProgElemStatsPid to preserve the construct prefix MpegOutputProgElemStats*. 16. Added mpegOutputUdpDestinationTable. 17. Deleted mpegProgramMappingDeviceChannelId and mpegProgramMappingInputIfIndex from MpegProgramMappingEntry. 18. MpegVideoSessionEntry Added: mpegVideoSessionPIDRemap, mpegVideoSessionMode, mpegVideoSessionEncryptionType, mpegVideoSessionEncryptionInfo, mpegVideoSessionBitRate, mpegVideoSessionSelectedInput. 19. MpegVideoSessionEntry Deleted: mpegVideoSessionUdpPort, mpegVideoSessionDestAddrType, mpegVideoSessionDestAddr, mpegVideoSessionSrcAddrType, mpegVideoSessionSrcAddr. 20. Added mpegVideoSessionPtrTable. 21. Updated mpegInputProgESGroup and mpegOutputProgElemStatsGroup description. 22. Updated OBJECT-GROUP mpegInputGroup, mpegInputProgESGroup, mpegOutputGroup, mpegMappingsGroup, mpegSessionsGroup. 23. Added mpegInputStatsPcrIntervalExceeds to the MPEG input statistics. 24. Added the table mpegInputUdpOriginationSessionTable.', ' Changes due to voting comments 1. Changed description of mpegInputTSPsiDetected. 2. Changed mpegInputTSRate, mpegInputTXMaxRate, mpegInsertPacketIndex, and mpegInsertPacketListId be Unsigned32 instead of Integer32. 3. Unit clause added to mpegOutputStatsAvailableBandwidth specifying bps. 4. Modified all references to QAM and used the word Device instead. 5. mpegOutputTSPmtInsertRate description changed, mpegOutputTSPmtInsertRate value changed to tables/ms. 6. mpegProgramMappingInputProgIndex in description changed rfDeviceInputProgIndex to mpegInputProgIndex. 7. mpegProgramMappingInputTSIndex in description changed rfDeviceInputTSIndex to mpgetInputTSIndex.', ' Changes due to voting comments 1. Removed TEXTUAL-CONVENTION import 2. Reworded the last sentence of the Module definition. 3. Reordered MIB tree to fit under the heDigital branch.', ' Added SCTE-HMS-HEADENDIDENT-TC name for HePidValue, remove name from this file. Created TC ProgDataType so it can be used everywhere. Removed 0 from enumerated types just for convention.',))
